import fetcher from '../fetcher';

const getApartment = async () => {
    try{
        const {data} = await fetcher.get("/apartments");
        return data;
    }catch(error){
        throw new Error(`Cant get apartments`);
    }
}


const getCountries = async () => {
    try {
        const countires = await fetcher.get('/countries');
        console.log("heree",  countires.data)
        return countires.data;
    }catch(error){
        console.log(error)
    }
} 

export {getCountries};
